import { Friend, LiItem } from "./friends.styled";

export const Friends = ({friends}) => {
    return (
        <Friend>
            {friends.map(friend => (
                <LiItem key={friend.id}>
                    {friend.name}</LiItem>
            ))}
            
        </Friend>
    );
}
